/**
 * Informações da chave.
 * @property {number} ver Se é compatível com o módulo blockchain.
 * @property {number} type Tipo da chave.
 * @property {string} xVer Versão da chave privada extendida (extended private key).
 * @property {number} xDepth Profundidade na árvore de chave privada extendida.
 * @property {string} xParentFp Impressão digital do pai da chave privada extendida.
 * @property {string} xChildNum Número do nó filho do XPriv BIP32. Zero-padded para objetos não BIP32.
 */
export default interface KeyInfo {
    ver: number;
    type: number;
    xVer: string;
    xDepth: number;
    xParentFp: string;
    xChildNum: string;
}
